import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import axios from 'axios';
import './style.css';

function Login() {
  const [loginFormData, setLoginFormData] = useState({
    username: '',
    password: '',
  });

  const [bookingFormData, setBookingFormData] = useState({
    date: '',
    timing: '',
    numberOfPeople: '',
  });

  const [loggedInUser, setLoggedInUser] = useState(null);

  const handleLoginChange = (e) => {
    setLoginFormData({ ...loginFormData, [e.target.id]: e.target.value });
  };

  const handleLoginSubmit = async (e) => {
    e.preventDefault();

    try {
      const response = await axios.post('http://localhost:8000/api/login/', loginFormData);
      console.log('Login Successful:', response.data);

      // Assuming the backend returns user data upon successful login
      setLoggedInUser(response.data);

      // You can also store the token in local storage or context for future requests
    } catch (error) {
      console.error('Login Failed:', error.response.data);
    }
  };

  const handleBookingChange = (e) => {
    const { name, value } = e.target;
    setBookingFormData((prevData) => ({
      ...prevData,
      [name]: value,
    }));
  };

  const handleBookingSubmit = (e) => {
    e.preventDefault();
    console.log('Booking Form submitted:', bookingFormData);
    // Add logic to send the booking data to the backend or perform further actions
  };

  return (
    <>
      <Link to="/" className="home-link">
        <button className="home-button">Home</button>
      </Link>
      <h2 className="name-rest">Login</h2>
      <br />
      <br />
      <br />
      <div className="signup-container">
        <form className="signup-form" onSubmit={handleLoginSubmit}>
          <label htmlFor="username">Username</label>
          <input
            type="text"
            id="username"
            placeholder="Enter your username"
            onChange={handleLoginChange}
            required
          />

          <label htmlFor="password">Password</label>
          <input
            type="password"
            id="password"
            placeholder="Enter your password"
            onChange={handleLoginChange}
            required
          />
          <p />

          <button type="submit" className="signup-button">
            Login
          </button>
        </form>
      </div>
      <div className='form-below'>
        Don't have an account?
        <Link to="/Signup">SignUp</Link>
      </div>

      {loggedInUser && (
        <div className="booking-page-container">
          <Link to="/" className="home-link">
            <button className="home-button">Home</button>
          </Link>
          <div className="booking-form-container card-container">
            <h1>Book a Table at The Happy Place</h1>
            <form onSubmit={handleBookingSubmit}>
              <div className="form-group">
                <label htmlFor="date">Select Date:</label>
                <input
                  type="date"
                  id="date"
                  name="date"
                  value={bookingFormData.date}
                  onChange={handleBookingChange}
                  required
                />
              </div>

              <div className="form-group">
                <label htmlFor="timing">Select Timing:</label>
                <input
                  type="time"
                  id="timing"
                  name="timing"
                  value={bookingFormData.timing}
                  onChange={handleBookingChange}
                  required
                />
              </div>

              <div className="form-group">
                <label htmlFor="numberOfPeople">Number of People:</label>
                <input
                  type="number"
                  id="numberOfPeople"
                  name="numberOfPeople"
                  value={bookingFormData.numberOfPeople}
                  onChange={handleBookingChange}
                  required
                />
              </div>
              <button type="submit">Book Now</button>
            </form>
          </div>
        </div>
      )}
    </>
  );
}

export default Login;
